const Newproducts = () => {
    const { np } = propc;
    return(
        <div className="col-xl-3 col-lg-3 col-md-3 col-sm-6 col-6">
            <div className="card text-center card-product">
                <div className="card-product__img">
                    <Link  href={`/listproduct?slug=${ np.slug }-${ np.id }`}>
                        <a><img src={ np.image.sourceUrl} alt="Product image"/></a>
                    </Link>
                    
                </div>
                <div>
                    <h4 className="card-product__title"><a href="#">{ np.name ? np.name : '' }</a></h4>
                </div>
            </div>
        </div>
    );
}
export default Newproducts;
